Modify the Dataflow Based on Row-Level Security

Itâ€™s now time to add the predicate in the dataflow definition file.

You add the predicate to the Register transformation that registers the OppTeamMember dataset as shown below.

{    
   "Extract_OpportunityTeamMember": {        
      "action": "sfdcDigest",        
      "parameters": {            
         "object": "OpportunityTeamMember",            
         "fields": [                
            { "name": "Name" },                
            { "name": "OpportunityId" },                
            { "name": "UserId" }            
         ]        
      }    
   },        
   "Extract_Opportunity": {        
      "action": "sfdcDigest",        
      "parameters": {            
         "object": "Opportunity",            
         "fields": [                
            { "name": "Id" },                
            { "name": "Name" },                
            { "name": "Amount" },                
            { "name": "StageName" },                
            { "name": "AccountId" },                
            { "name": "OwnerId" }            
         ]        
      }   
   },    
   "Augment_OpportunityTeamMember_Opportunity": {        
      "action": "augment",        
      "parameters": {            
         "left": "Extract_OpportunityTeamMember",            
         "left_key": [                
            "OpportunityId"            
         ],            
         "relationship": "TeamMember",            
         "right": "Extract_Opportunity",            
         "right_key": [                
            "Id"            
         ],            
         "right_select": [                
            "Name","Amount"            
         ]        
      }    
   },    
   "Register_Dataset": {        
      "action": "sfdcRegister",        
      "parameters": {        
         "alias": "OppTeamMember",        
         "name": "OppTeamMember",        
         "source": "105_Augment_OpportunityTeamMember_Opportunity",            
         "rowLevelSecurityFilter": "'UserId' == \"$User.Id\""        
      }    
   }
}
